import './App.css';
import AIToolList from './components/AIToolList';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <h1>AI Tools App</h1>
        <div>
        <a href="/">Platform</a>
        <a href="/">Solutions</a>
        <a href="/">Resources</a>
        <a href="/">Pricing</a>
        </div>
      </nav>
      <header className="App-header">
        <div className="hero">
          <h1>The 50 Best AI Tools for 2025 (Tried and Tested)</h1>
          <img src="https://via.placeholder.com/800x400" alt="AI Tools" />
        </div>
        <AIToolList />
      </header>
    </div>
  );
}

export default App;
